import { menuItem } from "../utils/menu_items";
const Menu = () => {
  console.log(menuItem);
  return (
    <div className="menu p-0 m-0 d-flex justify-content-center align-items-center">
      <div className="p-0 m-0 d-flex row justify-content-start align-items-start">
        {menuItem?.map((item) => {
          return (
            <div
              key={item.name}
              className="col-md-3 col-sm-6 col-10

            "
            >
              <div className="p-0 m-0 ">
                <img
                  className="img-fluid p-0 m-0 w-100"
                  src={item.image}
                  alt="bonte-item"
                />
              </div>
              <div>
                <label>Name : </label>
                <h3>{item.name}</h3>
              </div>
              <div>
                <strong>Price : {item.price}</strong>
              </div>
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default Menu;
